PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "last_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "background_task_completedtask" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "task_params" text NOT NULL, "task_hash" varchar(40) NOT NULL, "verbose_name" varchar(255) NULL, "priority" integer NOT NULL, "run_at" datetime NOT NULL, "repeat" bigint NOT NULL, "repeat_until" datetime NULL, "queue" varchar(190) NULL, "attempts" integer NOT NULL, "failed_at" datetime NULL, "last_error" text NOT NULL, "locked_by" varchar(64) NULL, "locked_at" datetime NULL, "creator_object_id" integer unsigned NULL CHECK ("creator_object_id" >= 0), "creator_content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "task_name" varchar(190) NOT NULL);
CREATE TABLE IF NOT EXISTS "background_task" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "task_params" text NOT NULL, "task_hash" varchar(40) NOT NULL, "verbose_name" varchar(255) NULL, "priority" integer NOT NULL, "run_at" datetime NOT NULL, "repeat" bigint NOT NULL, "repeat_until" datetime NULL, "queue" varchar(190) NULL, "attempts" integer NOT NULL, "failed_at" datetime NULL, "last_error" text NOT NULL, "locked_by" varchar(64) NULL, "locked_at" datetime NULL, "creator_object_id" integer unsigned NULL CHECK ("creator_object_id" >= 0), "creator_content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "task_name" varchar(190) NOT NULL);
CREATE TABLE IF NOT EXISTS "oauth2_provider_application" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "client_id" varchar(100) NOT NULL UNIQUE, "redirect_uris" text NOT NULL, "client_type" varchar(32) NOT NULL, "authorization_grant_type" varchar(32) NOT NULL, "client_secret" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "user_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "skip_authorization" bool NOT NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "oauth2_provider_grant" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(255) NOT NULL UNIQUE, "expires" datetime NOT NULL, "redirect_uri" varchar(255) NOT NULL, "scope" text NOT NULL, "application_id" bigint NOT NULL REFERENCES "oauth2_provider_application" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "created" datetime NOT NULL, "updated" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "oauth2_provider_accesstoken" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "token" varchar(255) NOT NULL UNIQUE, "expires" datetime NOT NULL, "scope" text NOT NULL, "application_id" bigint NULL REFERENCES "oauth2_provider_application" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "created" datetime NOT NULL, "updated" datetime NOT NULL, "source_refresh_token_id" bigint NULL UNIQUE REFERENCES "oauth2_provider_refreshtoken" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "oauth2_provider_refreshtoken" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "token" varchar(255) NOT NULL, "application_id" bigint NOT NULL REFERENCES "oauth2_provider_application" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "created" datetime NOT NULL, "updated" datetime NOT NULL, "revoked" datetime NULL, "access_token_id" bigint NULL UNIQUE REFERENCES "oauth2_provider_accesstoken" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "users_profile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "image" varchar(100) NOT NULL, "change_password" bool NOT NULL, "date_created" datetime NULL, "date_updated" datetime NULL, "created_by_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "role_id" integer NULL REFERENCES "users_role" ("id") DEFERRABLE INITIALLY DEFERRED, "updated_by_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_agent" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(20) NOT NULL UNIQUE, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "commission" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "sequences_sequence" ("name" varchar(100) NOT NULL PRIMARY KEY, "last" integer unsigned NOT NULL CHECK ("last" >= 0));
CREATE TABLE IF NOT EXISTS "websocket_callgroup" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "pin" varchar(100) NOT NULL, "status" integer NOT NULL, "created_at" datetime NULL, "updated_at" datetime NULL, "offer" varchar(1000) NULL);
CREATE TABLE IF NOT EXISTS "sales_batch" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created_at" datetime NOT NULL, "file_in" varchar(100) NOT NULL, "file_out" varchar(100) NULL, "status" integer NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "read" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "sales_document" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "description" varchar(100) NULL, "file" varchar(100) NOT NULL, "created_at" datetime NULL, "updated_at" datetime NULL, "ref_number" varchar(20) NOT NULL, "doc_type" varchar(10) NOT NULL, "sale_id" integer NOT NULL REFERENCES "sales_sale" ("id") DEFERRABLE INITIALLY DEFERRED, "truck" varchar(10) NOT NULL, "user_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_audit" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "method" varchar(1000) NOT NULL, "ip_address" varchar(50) NOT NULL, "created_on" datetime NOT NULL, "updated_on" datetime NULL, "path" varchar(50) NULL, "username" varchar(50) NULL, "status" integer NULL);
CREATE TABLE IF NOT EXISTS "invoices_invoice" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "number" varchar(20) NOT NULL, "commission" decimal NOT NULL, "quantity" decimal NOT NULL, "value" decimal NOT NULL, "status" integer NOT NULL, "created_at" datetime NULL, "updated_at" datetime NULL, "agent_id" integer NOT NULL REFERENCES "users_agent" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "invoices_invoicedoc" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "ref_number" varchar(20) NOT NULL, "description" varchar(100) NULL, "doc_type" varchar(10) NOT NULL, "created_at" datetime NULL, "updated_at" datetime NULL, "invoice_id" integer NOT NULL REFERENCES "invoices_invoice" ("id") DEFERRABLE INITIALLY DEFERRED, "file" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "makerchecker_tasktype" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(40) NOT NULL, "maker_privilege" varchar(40) NOT NULL, "checker_privilege" varchar(40) NOT NULL, "executor" varchar(40) NOT NULL, "view_privilege" varchar(40) NOT NULL);
CREATE TABLE IF NOT EXISTS "users_role" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(40) NOT NULL UNIQUE, "description" varchar(100) NULL, "created_at" datetime NULL, "updated_at" datetime NULL, "privileges" varchar(229) NULL);
CREATE TABLE IF NOT EXISTS "makerchecker_task" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "maker_comment" varchar(40) NOT NULL, "checker_comment" varchar(40) NULL, "reference" varchar(40) NOT NULL, "result" varchar(100) NULL, "created_at" datetime NULL, "updated_at" datetime NULL, "checker_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "maker_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "task_type_id" integer NOT NULL REFERENCES "makerchecker_tasktype" ("id") DEFERRABLE INITIALLY DEFERRED, "status" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "sales_sale" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sales_order" varchar(100) NOT NULL UNIQUE, "transaction_date" varchar(20) NOT NULL, "customer_name" varchar(100) NOT NULL, "delivery_note" varchar(100) NOT NULL, "vehicle_number" varchar(100) NOT NULL, "vehicle_number_trailer" varchar(100) NULL, "tax_invoice" varchar(100) NOT NULL, "product_name" varchar(100) NOT NULL, "quantity" decimal NOT NULL, "total_value" decimal NOT NULL, "quantity2" decimal NULL, "total_value2" decimal NULL, "destination" varchar(100) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "assign_no" varchar(20) NULL, "agent_id" integer NULL REFERENCES "users_agent" ("id") DEFERRABLE INITIALLY DEFERRED, "invoice_id" integer NULL REFERENCES "invoices_invoice" ("id") DEFERRABLE INITIALLY DEFERRED, "task_id" integer NULL REFERENCES "makerchecker_task" ("id") DEFERRABLE INITIALLY DEFERRED);
